import React from "react";
import {Fragment, Label} from 'react'
import { Form, FormControl, Button, Jumbotron } from "react-bootstrap";

const divStyle = {
  marginLeft: "auto",
 marginRight: 'auto',
 marginTop:'25%',

  width: "36rem",
  color: "black"

}


const NewPost=(props) => {

  console.log(props)
  return (
    <Jumbotron>

    <>
    Upload Photo
  <Form.Control size="lg" type="text" placeholder="picture" value={props.state.picture}  name="picture" onChange={(e)=>props.hanldeChange(e)} />
  <br />
  Caption
  <Form.Control type="text" placeholder="caption" name="caption" value={props.state.capiton} onChange={(e)=> props.handleChange(e)}/>
  <br />

  <Button variant="primary" type="submit">
    Submit
  </Button>

</>

    </Jumbotron>
  );
}
export default NewPost;
